export default function SearchResults({results}){   
    return(
        <div>
            {results?.map((value) => {
                return(
                    <div key={value.id} style={{backgroundColor:"#E8E7E7", marginTop: "1rem", marginBottom: "1rem", padding: 10 }}>
                        <p>{value.name}</p>
                        <p>{value.email}</p>
                    </div>
                );
            })}
        </div>
    );
}
